You can ignore this group, basically.

But if you want to know what's going on, it's:
- separating the frequencies for the original and relit images (I like keeping the blur radius at around 1-3);
- remapping the relit image's low frequency layer 4 times (well, 3 really since the first remap is 0-1), in order to get rid of blown out highlights;
- color matching the relit image's low frequency remapped layers to the original image; 
- recombining the color matched low frequency layers and the original image's high frequency layer.

